const SizeChartScreen = () => {
	return (
		<>
			<div>
				<h1> Size Chart </h1>
				<img
					src="/images/Size-Chart.jpg"
					style={{ width: '1300px', marginLeft: '80px' }}
				/>
			</div>
		</>
	);
};

export default SizeChartScreen;
